import React, { Component } from "react";
import Slider from "react-slick";

export default class SliderShow extends Component {
  render() {
    const settings = {
      autoplay: true,
      autoplaySpeed: 2000,
      prevArrow: false,
      nextArrow: false,
      dots: true,
    };
    return (
      <div className="wrapper box">
  <div className="single-box">
    <img alt="" src="1.jpg" />
  </div>
  <div className="single-box">
    <img alt="" src="2.jpg" />
  </div>
  <div className="single-box">
    <img alt="" src="3.jpg" />
  </div>
  <div className="single-box">
    <img alt="" src="4.jpg" />
  </div>
</div>

    );
  }
}
